import React from "react";
import Home from "./components/Home.jsx";
import Login from "./components/Login.jsx";
import CustomerSignup from "./components/CustomerSignup.jsx";
import RestaurantSignup from "./components/RestaurantSignup.jsx";
import RestaurantDashboard from "./components/RestaurantDashboard.jsx";
import "bootstrap/dist/css/bootstrap.min.css";
import LoginData from "./LoginData.js";
import {BrowserRouter as Router,Switch,Route} from "react-router-dom";


function App() {
  return (
    <div className="App">
    <Router>
    <Switch>
      <Route exact path="/" component={Home} />
      <Route path="/Login.jsx" component={Login}
      href={LoginData[0].href}
      pageName={LoginData[0].pageName}
      />
      <Route path="/Login.jsx"
      href={LoginData[1].href}
      pageName={LoginData[1].pageName}
      />
      <Route path="/CustomerSignup" component={CustomerSignup} />
      <Route path="/RestaurantSignup" component={RestaurantSignup} />
      <Route path="/RestaurantDashboard" component={RestaurantDashboard} />
    </Switch>
  </Router>
   </div>
  );
}



export default App;
